  \"2015-01-22T14:18:45.876681\",\n\t\"name\": \"tiger-line-shapefile-2012-series-information-file-for-the-current-state-legislative-district-sl53cad\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from the U.S.n               Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB represents a seamlessn               national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent data set, or they can ben               combined to cover the entire
  nation. State Legislative Districts (SLDs) are the areas from which members are
  elected to State legislatures. The SLDs embody then               upper (senate)
  and lower (house) chambers of the State legislature. Nebraska has a unicameral legislature
  and the District of Columbia has a single council,n               both of which
  the Census Bureau treats as upper-chamber legislative areas for the purpose of data
  presentation; there are no data by SLDL for either Nebraskan               or the
  District of Columbia. A unique three-character census code, identified by State
  participants, is assigned to each SLD within a State. In Connecticut,n               Hawaii,
  Illinois, Louisiana, Maine, Maryland, Massachusetts, New Jersey, Ohio, and Puerto
  Rico, the Redistricting Data Program (RDP) participant did not definen               the
  SLDs to cover all of the State or State equivalent area. In these areas with no
  SLDs defined, the code \"ZZZ\" has been assigned, which is treated withinn               county
  as a single SLD for purposes of data presentation. The boundaries of the 2010 Census
  State legislative districts were provided by State-leveln               participants
  through the Redistricting Data Program (RDP) and reflect the districts used to elect
  members in the last election before 2010.n            \",\n\t\"license_title\":
